import ali from "../image/ali.png";

export default () => {
  <div className="swipe">
    <div className="pic">
      <div className="image-wrapper">
        <div className="overlay"></div>
        <img src="" alt="Skills"></img>
      </div>
      <div className="image-wrapper">
        <div className="overlay"></div>
        <img src={ali} alt="About"></img>
      </div>
      <div className="image-wrapper">
        <div className="overlay"></div>
        <img src="" alt="Contact"></img>
      </div>
    </div>
    <style jsx>{`
      img {
        margin-top: 60px;
        width: 250px;
        height: 250px;
        filter: grayscale(100%);
      }
      .pic {
        display: flex;
        justify-content: space-around;
        margin-top: 20px;
      }
      .overlay {
        width: 100%;
        height: 100%;
        position: absolute;
        background-color: rgb(128, 125, 125);
        top: 100%;
      }
      .image-wrapper {
        position: relative;
        margin: 10px;
        overflow: hidden;
      }
    `}</style>
  </div>;
};
